import { Card } from 'react-bootstrap';

export default function Produto(props) {
    return (
        <Card className="area_produto" onMouseMove="mousedentro(this)" onMouseOut="mousefora(this)">
            <div className={props.categoria}>
                <img src= {require(`../img/${prop.imagem}`).default} alt ="Imagem do produto" />

            </div>
        </Card>
    )
}
